contracts/EelswapFactory.sol.content:
pragma solidity ^0.8.0;

import './interfaces/IEelswapFactory.sol';

contract EelswapFactory is IEelswapFactory {
    mapping(address => mapping(address => address)) public override getPair;
    address[] public override allPairs;

    event overridePairCreated(address indexed token0, address indexed token1, address pair, uint);

    constructor(address _feeToSetter)public {

    }

    function allPairsLength() override external view returns (uint) {
        return allPairs.length;
    }

    function createPair(address tokenA, address tokenB) override external returns (address pair) {
        require(tokenA != tokenB, "Identical Addresses");
        // This is done to ensure the 
        (address token0, address token1) = tokenA < tokenB ? (tokenA, tokenB) : (tokenB, tokenA);
        
    }
}

